%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%Muon Plots as functions of time%%%Muon Count Plotfigure(1);subplot(2,2,1);plot(MuonDailyAve, '--o');title('Muon Daily Average');ylim([80 90]);xlim([0 70]);ylabel('Number of Muons');xlabel(' Jan-01-2017 to March-17-2017');grid onlegend('Daily Average');%Pascal(Pressure Plot)subplot(2,2,2);plot(PascalDailyAve, '--dr');title('Average Daily Pressure Readings ');xlim([0 70]);ylabel('Pascals');xlabel(' Jan-01-2017 to March-17-2017');grid onlegend('Pressure Readings');%Temperature Plotsubplot(2,2,3);plot(TemperatureDailyAve, '--db');title('Average Temperature Pressure Readings ');xlim([0 70]);ylabel('Temperatures (Celsius)');xlabel(' Jan-01-2017 to March-17-2017');grid onlegend('Temperature Values');%WindSpeed PLotsubplot(2,2,4);plot(WindSpeedDailyAve, '--dg');title('WindSpeed Daily Averages as Function of Time ');xlim([0 70]);ylabel('WindSpeed )');xlabel(' Jan-01-2017 to March-17-2017');grid onlegend('Wind Speed Daily Averages');%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%Cloud Layer Plotfigure(2);subplot(2,2,1);plot(MuonDailyAve, '--o');title('Muon Daily Average');ylim([80 90]);xlim([0 70]);ylabel('Number of Muons');xlabel(' Jan-01-2017 to March-17-2017');grid onlegend('Daily Average');subplot(2,2,2);plot(CloudLayer1, '--dm');grid ontitle('Cloud Layer1 Daily Average');xlim([0 70]);ylabel('Cloud Data');xlabel(' Jan-01-2017 to March-17-2017');legend('Daily Average');%DewPoint Plotsubplot(2,2,3);plot(DewPoint, '--dblack');grid ontitle('Dew Point Daily Average Intake ');xlim([0 70]);ylabel('Dew Point ');xlabel(' Jan-01-2017 to March-17-2017');legend('Daily Average');%Humidity Plotsubplot(2,2,4);plot(Humidity, '--vb');grid ontitle('Daily Humidity Percentage Average');xlim([0 70]);ylabel('Absolute Humidity');xlabel(' Jan-01-2017 to March-17-2017');legend('Daily Average');%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%Plotting Muon count vs various factors to see relationships%Can test plots as functions of each other; muon vs pressure, etc...%Temperature vs Muon Countfigure(3);hold on grid onplot(TemperatureDailyAve,'--vr');yyaxis rightylabel('Muon Count');ylim([80 90]);plot(MuonDailyAve,'b');yyaxis leftylabel('Temperature (Celsius)');ylim([-20 20]);xlim([0 70]);xlabel('Dates');legend('Temperature Averages', 'Muon Count');title('Muon Count vs Temperature Relation Plot');hold off%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%WindSpeed vs Muon Countfigure(4);hold on grid ontitle('Wind Speed vs Muon Count Plot');plot(WindSpeedDailyAve,'--dr');yyaxis rightylabel('Muon Count');ylim([80 90]);plot(MuonDailyAve,'--db');yyaxis leftylabel('Wind Speeds');ylim([0 10]);xlim([0 70]);xlabel('Dates');legend('Wind Speed', 'Muon Count');hold off%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%Pascal(Pressure) Plotfigure(5);hold on grid onplot(PascalDailyAve,'--vr');title('Pascal Readings vs Muon Count Plot');yyaxis rightylabel('Muon Count');ylim([80 90]);plot(MuonDailyAve,'--vb');yyaxis leftylabel('Pascal Scale Daily Average');xlim([0 69]);xlabel('Dates');legend('Pascal Daily Readings', 'Muon Count');hold off%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%Humidity vs Muon Countfigure(6);hold on grid onplot(Humidity,'--rp');title('Humidity Readings vs Muon Count Plot');yyaxis rightylabel('Muon Count');ylim([80 90]);plot(MuonDailyAve,'--vb');yyaxis leftylabel('Absolute Humidity');xlim([0 69]);xlabel('Dates');legend('Humidity Daily Averages', 'Muon Count');hold off%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%DewPoint vs Muon Countfigure(7);hold on grid onplot(DewPoint,'--vblack');title('Dew Point vs Muon Count Plot');yyaxis rightylabel('Muon Count');ylim([80 90]);plot(MuonDailyAve,'--pblue');yyaxis leftylabel('Dew Point Averages');xlim([0 69]);xlabel('Dates');legend('Dew Point', 'Muon Count');hold off%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%CloudLayer vs Muon Countfigure(8);hold on grid onplot(CloudLayer1,'--diamond r');title('CloudLayer vs Muon Count Plot');yyaxis rightylabel('Muon Count');ylim([80 90]);plot(MuonDailyAve,'--pblue');yyaxis leftylabel('Cloud Layer 1');xlim([0 69]);xlabel('Dates');legend('CloudLayer 1', 'Muon Count');hold off%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%Scatter plot creation for developing relationship modelsfigure(9)scatter(DewPoint,MuonDailyAve,'filled');xlabel('Dew Point');ylabel('Muon Count');title('Muon Count vs Dew Point Scatter Plot');%%figure(10)scatter(PascalDailyAve,MuonDailyAve,'filled');xlabel('Pascal Daily Ave');ylabel('Muon Count');title('Pascal Count vs Muon Count');%%figure(11)scatter(Humidity,MuonDailyAve,'filled');xlabel('Humidity Daily Averages');ylabel('Muon Daily Count');title('Humidity points vs Muon Daily Count Scatter Plot');%%figure(12)scatter(WindSpeedDailyAve,MuonDailyAve,'filled');xlabel('Wind Speed Daily Averages');ylabel('Muon Counts');title('Wind Speed Data vs Muon Count');%%figure(13)scatter(TemperatureDailyAve,MuonDailyAve,'filled');xlabel('Temperature Averages');ylabel('Muon Counts');title('Muon Count vs Temperature Daily Scatter Plots');save MuonFactorPlots MuonDailyAve PascalDailyAve TemperatureDailyAve WindSpeedDailyAve CloudLayer1 DewPoint Humidity;